import "./App.css";
import RaffleForm from "./components/RaffleForm";
import Background from "./assets/50_50-101.png";
function App() {
  return (
    <div
      className="App"
      style={{
        backgroundImage: `url(https://miro.medium.com/max/1225/1*TCs1_KP3xoZIC2P0c_Owlw.png)`,
        backgroundPosition: "center",
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
      }}
    >
      <RaffleForm></RaffleForm>
    </div>
  );
}

export default App;
